import React from 'react';
import {Row, Col } from 'react-bootstrap';

export default function Albums() {
    return (
            <Row style={{alignItems: center}}>
                <Col>Lyric</Col>

                <Col>
                    <Row>
                        <Col>
                            Song Title
                        </Col>
                        <Col>
                            <img src={"https://lastfm.freetls.fastly.net/i/u/300x300/668a0fb5abec4850c754d83f2e4c405d.png"}/>
                        </Col>
                    </Row>
                </Col>

                <Col>Text</Col>
            </Row>
    )
}
